import './App.css';
import ReactApexChart from 'react-apexcharts'
import { useState } from 'react';
import DSA from "./components/DSA.js"
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'


function App() {
    return (
      <Router>
        <div>
          <Route path="/" component={DSA}/>
        </div>
      </Router>
    );
  }

export default App;
